console.log(image2);

function recomend() {
  return (
  <div className="App">

      <div classname="App-content">
      <header className="App-header">

        <h2>
          Recomend a movie
        </h2>
        </header>

      <div className="text"> 
        <p>
          Movie Name:
        </p>

        <p>
          Genre:
        </p>

        <p>
          Rate:
        </p>

        <img className="image1" src={image1} alt="image"/>

        <p>
          Description:
        </p>

        <p>
          Add picture:
        </p>

        <img className="image2" src={image2} alt="image"/>

      </div>

      <div className="share"> 
        <h3>
          Share this recomendation with a friend
        </h3>
      </div>


      </div>

  </div>


  );
}

export default recomend;
